import React, { useEffect } from 'react';

function Table(props) {
  console.log(props);

	function onChange() {
		// Find the task we want to update and update it
		props.setTasks(tasks => tasks.map(task => {
			if (task.id === props.id) {
				return {
					id: task.id,
					description: task.description,
					completed: !task.completed
				};
			} else {
				return task;
			}
		}));
	}

	function onClick() {
		// Find the task we want to delete and remove it
		props.setTasks(tasks => tasks.filter(task => task.id !== props.id));
	}
  return (
    <div id="new_contact">
      <table>
        {/* <tr>
          <th><h4>Type</h4></th>
          <th><h4>Number</h4></th>
        </tr> */}
        <tr>
          <th>{props.type}</th>
          <th>{props.number}</th>
          <th><button id = "dl3" class = "button2" onClick={onClick}>Delete</button></th>
        </tr>


      </table>

    </div>
  );
}

export default Table;
